import axios from 'axios'

export const getBreeds = () => {
    axios('https://frontend-take-home-service.fetch.com/dogs/breeds', {
        method: 'GET',
        withCredentials: true,
    })
        .then((res) => {
            console.log(res);
        })
        .catch((err) => {
            console.log(err.response);
        });
};
